import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

export default function Dashboard({ setIsAuth }) {
  const [emailId, setEmailId] = useState('');
  const [appPassword, setAppPassword] = useState('');
  const [csv, setCsv] = useState(null);
  const [subject, setSubject] = useState('');
  const [body, setBody] = useState('');
  const [cc, setCc] = useState('');
  const [attachments, setAttachments] = useState([]);
  const [msg, setMsg] = useState('');
  const [step, setStep] = useState(1);
  const navigate = useNavigate();

  const handleCreds = (e) => {
    e.preventDefault();
    setStep(2);
  };

  const handleBulkMail = async (e) => {
    e.preventDefault();
    if (!csv) return setMsg('Please upload a CSV file.');
    const formData = new FormData();
    formData.append('csv', csv);
    formData.append('subject', subject);
    formData.append('body', body);
    formData.append('email_id', emailId);
    formData.append('app_password', appPassword);
    if (cc) formData.append('cc', cc);
    for (let i = 0; i < attachments.length; i++) {
      formData.append('attachments', attachments[i]);
    }
    try {
      const res = await axios.post('http://localhost:3000/send-bulk-emails', formData);
      setMsg(res.data.message);
    } catch (err) {
      setMsg(err.response?.data?.message || 'Error sending emails');
    }
  };

  return (
    <div>
      <h2>Dashboard</h2>
      {step === 1 ? (
        <form className="creds-form" onSubmit={handleCreds}>
          <h3>Enter Email Credentials for Sending</h3>
          <input placeholder="Gmail Email ID" type="email" value={emailId} onChange={e => setEmailId(e.target.value)} required />
          <input placeholder="App Password" type="password" value={appPassword} onChange={e => setAppPassword(e.target.value)} required />
          <button type="submit">Continue</button>
        </form>
      ) : (
        <form className="bulkmail-form" onSubmit={handleBulkMail}>
          <h3>Send Bulk Emails</h3>
          <label htmlFor="csv-upload">Recipient CSV File</label>
          <input id="csv-upload" type="file" accept=".csv" onChange={e => setCsv(e.target.files[0])} required />
          <label htmlFor="subject">Subject (use {{name}} for personalization)</label>
          <input id="subject" placeholder="Subject" value={subject} onChange={e => setSubject(e.target.value)} required />
          <label htmlFor="body">Body (use {{name}} for personalization)</label>
          <textarea id="body" placeholder="Body" value={body} onChange={e => setBody(e.target.value)} required />
          <label htmlFor="cc">CC (comma separated emails)</label>
          <input id="cc" placeholder="CC" value={cc} onChange={e => setCc(e.target.value)} />
          <label htmlFor="attachments">Attachments</label>
          <input id="attachments" type="file" multiple onChange={e => setAttachments(e.target.files)} />
          <button type="submit">Send Emails</button>
        </form>
      )}
      {msg && <div style={{ color: msg.includes('success') ? 'green' : 'red', fontWeight: 500, marginTop: 10 }}>{msg}</div>}
    </div>
  );
}
